import icons from "url:../Assets/img/icons.svg";

const Pagination = () => {
  const curPage = 0;
  return `
    <button data-goto="${
      curPage + 1
    }" class="btn--inline pagination__btn--next">
      <span>Page ${curPage + 1}</span>
      <svg class="search__icon">
        <use href="${icons}#icon-arrow-right"></use>
      </svg>
    </button>
   `;
};

export default Pagination;
